import React from "react"
import Item from './Item';
function Soucial(){
    return(
   <ul className="list-group">
    <Item 
    json={
        {midea: "Facbook", 
        id :"facbook",
        img:'https://picsum.photos/63'}
    }
    />
    <Item 
    
    midea="Instagrm" 
    id="instagrm" 
    img='https://picsum.photos/62'
    />
    <Item 
    midea="Iinkden" 
    id="linkden"
    img= 'https://picsum.photos/61'
    />
   </ul>
    );
}
export default Soucial;
